svg.script:
		document.getElementById("svgroot").addEventListener("click", sendClickToParentDocument, false);
		function sendClickToParentDocument(evt)
		{
			// SVGElementInstance objects aren't normal DOM nodes, so fetch the corresponding 'use' element instead
			var target = evt.target;
			if(target.id === "animation-video"){
				window.parent.document.getElementById("image-source").src = "./room/assets/img/svgs/room1/popup/cordless-power-tool.mp4";
				window.parent.document.getElementById("video").style.display = "block";
				window.parent.document.getElementById("close-video").addEventListener("click", closeVideo, false);
			}
		}

		function closeVideo() {
			window.parent.document.getElementById("video").style.display = "none";
			window.parent.document.getElementById("image-source").pause();
		}
